                <i style={{
                    position: "relative",

                    top: "50%",
                    bottom: "50%",

                    left: "50%",
                }} className="caret square left icon"></i>
            </div>
            <div className="fourteen wide column">
                <img style={{ height: "100px" }} className="ui fluid image" src="https://upload.wikimedia.org/wikipedia/commons/6/65/Jimmy_Wales_September_2015.jpg" />
            </div>
            <div className="one column">
                <i
                    style={{
                        position: "absolute",

                        top: "50%",
                        bottom: "50%",

                        right: "50%"
                    }}
                    className="caret square right icon" ></i>
            </div>
        </div >

    )
}

